(54, 1, '2021-03-16 15:24:10', '2021-03-16 15:24:10', '<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Our website address is: http://localhost:81/chainetv/wordpress.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Comments</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Media</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Embedded content from other websites</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you request a password reset, your IP address will be included in the reset email.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where we send your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph -->', 'Privacy Policy', '', 'inherit', 'closed', 'closed', '', '3-revision-v1', '', '', '2021-03-16 15:24:10', '2021-03-16 15:24:10', '', 3, 'http://localhost:81/chainetv/wordpress/?p=54', 0, 'revision', '', 0),
(55, 1, '2021-03-16 15:24:13', '2021-03-16 15:24:13', '<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://localhost:81/chainetv/wordpress/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->', 'Sample Page', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2021-03-16 15:24:13', '2021-03-16 15:24:13', '', 2, 'http://localhost:81/chainetv/wordpress/?p=55', 0, 'revision', '', 0),
(56, 1, '2021-03-17 15:34:35', '2021-03-17 15:34:35', '<h2>Meilleur Séries du moment :</h2>\n<figure><img src=\"http://localhost:81/chainetv/wordpress/wp-content/uploads/2021/03/9c254ea10bb4cae78b454ef812562aad-169x300.jpg\" alt=\"9c254ea10bb4cae78b454ef812562aad\"></figure>\n<figure><img src=\"http://localhost:81/chainetv/wordpress/wp-content/uploads/2021/03/e49468b4541258c5a331b6a47bcc3a16-200x300.jpg\" alt=\"e49468b4541258c5a331b6a47bcc3a16\"></figure>\n<figure><img src=\"http://localhost:81/chainetv/wordpress/wp-content/uploads/2021/03/original-255x300.jpg\" alt=\"original\"></figure>\n<figure><img src=\"http://localhost:81/chainetv/wordpress/wp-content/uploads/2021/03/32983d7fd6c4395aaf1f0bea6af4d6a8-201x300.jpg\" alt=\"32983d7fd6c4395aaf1f0bea6af4d6a8\"></figure>\nPrevious\nNext\n<h6 style=\"text-align: center;\">Si vous n\'avez pas encore vu l\'émission, je vous implore de la regarder et ne vous inquiétez pas car la bande-annonce n\'est pas particulièrement un spoil.</h6>\nhttps://www.youtube.com/watch?v=xIBiJ_SzJTA\n<h2 style=\"text-align: left;\">Emitssion :</h2>\n<img width=\"728\" height=\"410\" src=\"http://localhost:81/chainetv/wordpress/wp-content/uploads/2021/03/Histoires_courtes_2.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost:81/chainetv/wordpress/wp-content/uploads/2021/03/Histoires_courtes_2.jpg 728w, http://localhost:81/chainetv/wordpress/wp-content/uploads/2021/03/Histoires_courtes_2-300x169.jpg 300w\" sizes=\"(max-width: 728px) 100vw, 728px\">\n<a href=\"#\" role=\"button\">\nClick here\n</a>\n<img width=\"728\" height=\"410\" src=\"http://localhost:81/chainetv/wordpress/wp-content/uploads/2021/03/des_chiffres_et_des_lettres_2.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost:81/chainetv/wordpress/wp-content/uploads/2021/03/des_chiffres_et_des_lettres_2.jpg 728w, http://localhost:81/chainetv/wordpress/wp-content/uploads/2021/03/des_chiffres_et_des_lettres_2-300x169.jpg 300w\" sizes=\"(max-width: 728px) 100vw, 728px\">\n<a href=\"#\" role=\"button\">\nClick here\n</a>\n<img width=\"728\" height=\"410\" src=\"http://localhost:81/chainetv/wordpress/wp-content/uploads/2021/03/8_chances_de_tout_gagner_2.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost:81/chainetv/wordpress/wp-content/uploads/2021/03/8_chances_de_tout_gagner_2.jpg 728w, http://localhost:81/chainetv/wordpress/wp-content/uploads/2021/03/8_chances_de_tout_gagner_2-300x169.jpg 300w\" sizes=\"(max-width: 728px) 100vw, 728px\">\n<a href=\"#\" role=\"button\">\nClick here\n</a>\n<h2 style=\"text-align: left;\">&nbsp;Actualité :</h2>\n<h5 style=\"text-align: left;\">Les choses se compliquent avec le vaccin AstraZeneca en Europe :</h5>\nHealth experts warn against travel, rolling back Covid restrictions, FEMA sent to U.S.-Mexico border amid surge in migrant children, and protests in London after murder of Sarah Everard.\n\nhttps://www.youtube.com/watch?v=y2BFVAX6PUM\n<h5 style=\"text-align: left;\">Prince Harry and Meghan sit down with Oprah for a revealing interview about leaving their roles as senior royals. :</h5>\n&nbsp;The reasons to be optimistic about the vaccine rollout and the road ahead. Plus, the officer charged with killing George Floyd goes on trial.\n\nhttps://www.youtube.com/watch?v=4Kj8UPnZfPc\n<h5 style=\"text-align: left;\">Les choses se compliquent avec le vaccin AstraZeneca en Europe. :</h5>\nBien que l’Organisation mondiale de la santé ait déclaré que l’utilisation était correcte, 11 pays européens - dont l’Allemagne, la France, l’Italie et l’Espagne - ont temporairement suspendu l’utilisation du vaccin......\n\nhttps://www.youtube.com/watch?v=jp81jA_F81I', 'Molotov.Tv', '', 'publish', 'closed', 'closed', '', 'molotov-tv', '', '', '2021-03-17 15:34:35', '2021-03-17 15:34:35', '', 0, 'http://localhost:81/chainetv/wordpress/?page_id=56', 0, 'page', '', 0),
