(120, 1, '2021-03-17 15:48:56', '2021-03-17 15:48:56', '<!-- wp:image {\"id\":119,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost:81/chainetv/wordpress/wp-content/uploads/2021/03/girl-2696947_1920-1024x1024.jpg\" alt=\"\" class=\"wp-image-119\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Les femmes du monde entier revendiquent et méritent un avenir égalitaire libre de préjugés, de stéréotypes et de violence ; un avenir durable et pacifique avec les mêmes droits et des chances égales pour toutes et tous. Pour y parvenir, le monde requiert la présence des femmes dans toutes les prises de décisions.</p>\n<!-- /wp:paragraph -->', 'lundi 8 mars', '', 'inherit', 'closed', 'closed', '', '90-revision-v1', '', '', '2021-03-17 15:48:56', '2021-03-17 15:48:56', '', 90, 'http://localhost:81/chainetv/wordpress/?p=120', 0, 'revision', '', 0),
(121, 1, '2021-03-18 08:26:31', '2021-03-18 08:26:31', '<!-- wp:image {\"id\":110,\"width\":649,\"height\":393,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://localhost:81/chainetv/wordpress/wp-content/uploads/2021/03/woman-1807533_1920-1024x622.jpg\" alt=\"\" class=\"wp-image-110\" width=\"649\" height=\"393\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong>Nous voulons aider les enfants à se divertir et à s\'informer sur la manière de prévenir la propagation du virus grâce à ces illustrations réalisées par Roger Zanni. Voici également des conseils de l\'Unicef sur comment parler aux enfants de la pandémie.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"block-1d540774-9026-4e2e-ab57-ee29883532b7\"><strong><br>Nous voulons aider les enfants à se divertir et à s\'informer sur la manière de prévenir la propagation du virus grâce à ces illustrations réalisées par Roger Zanni. Voici également des conseils de l\'Unicef sur comment parler aux enfants de la pandémie.</strong></p>\n<!-- /wp:paragraph -->', 'Programme d\'enfant', '', 'inherit', 'closed', 'closed', '', '109-revision-v1', '', '', '2021-03-18 08:26:31', '2021-03-18 08:26:31', '', 109, 'http://localhost:81/chainetv/wordpress/?p=121', 0, 'revision', '', 0),
